import React from "react";


export default function ForecastIcon(iconCode) {
  if (!iconCode) return <div>loading...</div>;
//   let forecastIconCode = iconCode.weather[0].icon;
  let forecastIconObject = {
    "01d": ClearSky,
    "01n": NightClearSky,
    "02d": FewClouds,
    "02n": NightFewClouds,
    "03d": Clouds,
    "03n": Clouds,
    "04d": Clouds,
    "04n": Clouds,
    "09d": Rain,
    "09n": Rain,
    "10d": Rain,
    "10n": Rain,
    "11d": Thunderstorm,
    "11n": Thunderstorm,
    "13d": Snow,
    "13n": Snow,
    "50d": Mist,
    "50n": NightMist,
  };
  console.log(iconCode);
  return (
    <img
      src={forecastIconObject[iconCode]}
      className="card-img img-fluid"
      alt="weather icon"
    />
  );
}
